	_createClass(Socialfold, [{
		key: 'init',
		value: function init() {
			var options = this.options;
			var socialFold = this;
			var size = 12;

			/**
    * Utility function for getting the total delay off of the constructor
    *
    * @returns {number}
    */
			var getTotalDelay = function getTotalDelay() {
				return size * socialFold.delayIncrement;
			};

			/**
    * Utility for calculating amount of rows based on total number of blocks
    *
    * @param n
    * @returns {number}
    */
			var getRows = function getRows(n) {
				var rows = 0;
				var modifier = 1;
				for (var i = n; i > 0; i) {
					i -= modifier;
					modifier++;
					rows++;
				}
				return rows;
			};

			/**
    * Construction of Blocks based on social links provided
    */
			var makeBlocks = function makeBlocks() {
				var output = '';

				var blockCounter = 0;
				var i = 1;

				while (i <= getRows(size)) {
					for (var j = 1; j <= i; j++) {
						if (blockCounter >= size) {
							console.log(options);
							break;
						}
						blockCounter++;
					}
					i++;
				}
			};

			/**
    * Primary function for folding and unfolding the SocialFold object
    * It is bound to the click even on the '#sf-master' DOM element
    *
    * @param totalDelay
    * @param delayIncrement
    */
			var fold = function fold(totalDelay, delayIncrement) {
				var blocks = document.getElementsByClassName('sf-block');
				for (var i = 0; i < blocks.length; i++) {
					blocks[i].classList.toggle('active');

					if (blocks[i].classList.contains('active')) {
						blocks[i].style.transitionDelay = delayIncrement * i + 'ms';
					} else if (!blocks[i].classList.contains('active')) {
						blocks[i].style.transitionDelay = totalDelay - i * delayIncrement + 'ms';
					}
				}
			};

			if (document.getElementById('sf-master') == null) {
				this.container.innerHTML += '<div id="sf-master" class="sf-block">social</div>';
			}

			for (var key in options) {
				this.container.innerHTML += '<div class="sf-block">' + this.svg[key] + '</div>';
				//size++;
			}

			makeBlocks();

			document.getElementById('sf-master').addEventListener('click', function () {
				fold(getTotalDelay(), socialFold.delayIncrement);
			});
		}
	}]);

